import React from 'react';
import ReactCountryFlag from "react-country-flag";

class Title extends React.Component {
  render() {
    return (
      <div className="title-container"> 
     
      <pre>         </pre>
      &nbsp;&nbsp;Please click to know the weather of the cities
      <br></br>
      <br></br>
      &nbsp;&nbsp;
      <ReactCountryFlag styleProps={{width: '20px',height: '20px'}} className="country" code="in" svg/>
      &nbsp;&nbsp;<span className="city" >Bangalore, India</span>
      <br></br>
      &nbsp;&nbsp;<ReactCountryFlag styleProps={{width: '20px',height: '20px'}} className="country" code="ky" svg/>
      &nbsp;&nbsp;<span className="city">Nairobi, Kenya</span>
      <br></br>
      &nbsp;&nbsp;<ReactCountryFlag styleProps={{width: '20px',height: '20px'}} className="country" code="se" svg/>
      &nbsp;&nbsp;<span className="city">Stockholm, Sweden</span>
           
      </div>
    );
  }
}

export default Title;
